import { Cookies } from 'react-cookie';
import fetch from 'isomorphic-unfetch';


export default class extends React.Component {
    render() {
        return (
            <>
                <ul>
                    {this.props.shows.map(show => (
                        <li key={show.id}>
                            <Link href="/p/[id]" as={`/p/${show.id}`}>
                                <a>{show.name}</a>
                            </Link>
                        </li>
                    ))}
                </ul>
            </>
        );
    }
}
